    // Â∞ÜÈü≥È¢ëÊï∞ÊçÆ‰øùÂ≠òÂà∞Êï∞ÊçÆÁõÆÂΩï‰∏∫Ëá™ÂÆö‰πâÂêçÁß∞ÁöÑÈü≥È¢ëÊñá‰ª∂
    private File saveAudioFile(byte[] audioData, String name) {
        File dataDir = context.getCacheDir();// Ëé∑ÂèñÂ∫îÁî®Á®ãÂ∫èÁºìÂ≠òÁõÆÂΩï
        try {
            File audioFile = new File(dataDir, name); // ÂàõÂª∫Èü≥È¢ëÊñá‰ª∂ÂØπË±°
            FileOutputStream outputStream = new FileOutputStream(audioFile); // ÂàõÂª∫Êñá‰ª∂ËæìÂá∫ÊµÅÔºåÁî®‰∫éÂ∞ÜÈü≥È¢ëÊï∞ÊçÆÂÜôÂÖ•Êñá‰ª∂
            outputStream.write(audioData); // Â∞ÜÈü≥È¢ëÊï∞ÊçÆÂÜôÂÖ•Êñá‰ª∂
            outputStream.close(); // ÂÖ≥Èó≠Êñá‰ª∂ËæìÂá∫ÊµÅ
            return audioFile; // ËøîÂõû‰øùÂ≠òÁöÑÈü≥È¢ëÊñá‰ª∂ÂØπË±°
        } catch (IOException e) {
            e.printStackTrace();
        }

        return null;
    }

    //Ëß£Á†ÅÂØπÂ∫îbase64Èü≥È¢ëÊñá‰ª∂Âπ∂‰ΩøÁî®Ëá™ÂÆö‰πâÂêçÁß∞‰øùÂ≠òÂú®Êï∞ÊçÆÁõÆÂΩï
    private void saveAudio(String base64EncodedAudio, String name) {
        byte[] decodedAudio = Base64.decode(base64EncodedAudio, Base64.DEFAULT); // Ëß£Á†ÅBase64ÁºñÁ†ÅÁöÑÈü≥È¢ëÊï∞ÊçÆ
        saveAudioFile(decodedAudio, name); // Â∞ÜËß£Á†ÅÂêéÁöÑÈü≥È¢ëÊï∞ÊçÆ‰øùÂ≠òÂà∞Êñá‰ª∂
    }

    //Âä®ÊÄÅÂä†ËΩΩÈü≥È¢ëÊñá‰ª∂Ëá≥Êú¨Âú∞
    private void initBase() {
        saveAudio(Switch_Open, SWITCH_OPEN);
        saveAudio(Switch_Shut, SWITCH_SHUT);
        saveAudio(CollapseMenu_Open, COLLAPSEMENU_OPEN);
        saveAudio(CollapseMenu_Shut, COLLAPSEMENU_SHUT);

        saveAudio(Click_Cartoon, CLICK_CARTOON);

        saveAudio(Inform_Message, INFORM_MESSAGE);
        saveAudio(Inform_Message_GTA, INFORM_MESSAGE_GTA);
        saveAudio(Inform_Success, INFORM_SUCCESS);
        saveAudio(Inform_Mistake, INFORM_MISTAKE);
        saveAudio(Inform_Alert, INFORM_ALERT);
    }

    //Êí≠ÊîæÊï∞ÊçÆÁõÆÂΩïÁöÑÂØπÂ∫îÂêçÁß∞ÁöÑÈü≥È¢ëÊñá‰ª∂
    public void playSoundEffect(String audioName) {

        if (audioName == null || context == null) {
            return;
        }
        try {
            //Âà§Êñ≠ÁºìÂ≠òÊñá‰ª∂Â§π‰∏ãÊòØÂê¶Â≠òÂú®ÈúÄË¶ÅÊí≠ÊîæÁöÑÈü≥‰πêÊñá‰ª∂ Â≠òÂú®ÊâçÊí≠ÊîæÔºÅ
            if (new File(context.getCacheDir().getAbsolutePath() + File.separator + audioName).exists()) {

                mediaPlayer = new MediaPlayer(); // ÂàõÂª∫Â™í‰ΩìÊí≠ÊîæÂô®ÂØπË±°
                mediaPlayer.setAudioStreamType(AudioManager.STREAM_MUSIC); // ËÆæÁΩÆÂ™í‰ΩìÊµÅÁ±ªÂûã‰∏∫Èü≥‰πêÊµÅ
                mediaPlayer.setDataSource(context.getCacheDir().getPath() + "/" + audioName); // ËÆæÁΩÆÂ™í‰ΩìÊí≠ÊîæÂô®ÁöÑÊï∞ÊçÆÊ∫ê‰∏∫‰º†ÂÖ•ÂêçÁß∞ÁöÑÈü≥È¢ëÊñá‰ª∂
                mediaPlayer.prepare(); // ÂáÜÂ§áÂ™í‰ΩìÊí≠ÊîæÂô®
                mediaPlayer.start(); // ÂºÄÂßãÊí≠ÊîæÈü≥È¢ë
                mediaPlayer.setOnCompletionListener(new MediaPlayer.OnCompletionListener() {
                        @Override
                        public void onCompletion(MediaPlayer mp) {

                            // Êí≠ÊîæÂÆåÊàêÂêéÈáäÊîæËµÑÊ∫ê
                            mp.release();
                        }
                    });
            }

        } catch (IOException e) {
            //DeBug.showDebugToast(context, "Èü≥ÊïàÊí≠ÊîæÂ§±Ë¥•",e.getMessage());
            e.printStackTrace();

        }

    }




